.watermark {
  position: absolute;
  bottom: 0px;
  right: 0px;
  font-size: 10px;
  background-color: rgba(255, 255, 255, 0.8);
}
.watermark p {
  margin: 0;
  color: #888;
  padding-left: 15px;
  padding-right: 10px;
  font-size: 10px;
  font-family: "Segoe UI", sans-serif;
}
.watermark-icon {
  width: 12px;
  height: 11px;
}
.position-absolute {
  position: absolute;
}
.hidden {
  display: none;
}
.diagnostics-text {
  cursor: pointer;
  text-decoration: none;
}
.diagnostics-text:hover {
  text-decoration: underline;
}
.diagnostics-div {
  position: absolute;
  top: 20px;
  left: 20px;
  right: 20px;
  bottom: 10px;
  box-sizing: border-box;
  background-color: #FAFBFB;
  z-index: 20;
  border-radius: 3px;
  border: 1px solid #D1D6DD;
  box-shadow: 0 4px 24px 0 rgba(37, 38, 94, 0.1);
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  overflow-y: auto;
  overflow-x: hidden;
  cursor: default;
}
.diagnostics-div textarea {
  position: absolute;
  left: 0px;
  right: 0px;
  top: 23px;
  bottom: 0px;
  padding: 5px;
  resize: none;
  font-size: 11px;
  display: inline-block;
  width: 100%;
  border: none;
  box-shadow: 0 1px 12px 0 rgba(51, 51, 51, 0.09);
  box-sizing: border-box;
}
.diagnostics-div textarea:focus {
  outline: none;
  outline-offset: 0px;
}
.diagnostics-div .close-cross {
  position: absolute;
  cursor: pointer;
  padding: 7px 3px;
  right: 0px;
  top: 0px;
  color: gray;
  width: 20px;
  height: 20px;
}
.diagnostics-div .close-cross path {
  stroke: gray;
  stroke-width: 1;
  fill: none;
}
.diagnostics-div span {
  position: absolute;
  left: 6px;
  top: 2px;
  font-size: 13px;
  color: gray;
}
.license-div {
  position: relative;
  margin: 0 auto;
  box-sizing: border-box;
  width: 80%;
  max-height: 100vh;
  min-width: 190px;
  max-width: 291px;
  background-color: #FAFBFB;
  z-index: 10;
  border-radius: 3px;
  border: 1px solid #D1D6DD;
  box-shadow: 0 4px 24px 0 rgba(37, 38, 94, 0.1);
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  overflow-y: auto;
  overflow-x: hidden;
  cursor: default;
}
.license-div .license-header {
  height: 58px;
  padding-left: 30px;
  padding-right: 20px;
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: white;
}
.license-div .license-header .license-logo {
  width: 99px;
  height: 20px;
  background-image: url("data:image/svg+xml;base64,");
  background-size: 99px 20px;
  background-repeat: no-repeat;
}
.license-div .license-header .license-gridline {
  height: 1px;
  width: 120px;
  background-color: #c5c5c5;
}
.license-div .license-header .close-cross {
  cursor: pointer;
  color: lightgray;
  width: 12px;
  height: 12px;
}
.license-div .license-header .close-cross path {
  stroke: lightgray;
  stroke-width: 1;
  fill: none;
}
.license-div .license-header .close-cross:hover path {
  stroke: gray;
}
.license-div .license-header .close-cross-disable {
  cursor: default;
}
.license-div .license-header .close-cross-disable:hover path {
  stroke: lightgray !important;
}
.license-div .line {
  box-sizing: border-box;
  width: 100%;
  height: 1px;
  background-color: #D1D6DD;
}
.license-div .inner-license {
  padding: 12px 30px 0px;
  position: relative;
}
.license-div .title-text {
  font-size: 20px;
  font-weight: bold;
  margin: 0 auto;
  text-align: center;
  margin-top: 30px;
}
.license-div .normal-text {
  font-size: 16px;
}
.license-div .info-text {
  margin: 0 auto;
  text-align: center;
}
.license-div .error-text {
  color: red;
}
.license-div .input-div {
  text-align: center;
  align-content: center;
  display: inline-block;
}
.license-div .link-div {
  margin-top: 10px;
  padding-bottom: 35px;
  text-align: center;
  align-content: center;
  display: flex;
  justify-content: space-around;
}
.license-div .link-div a {
  font-size: 12px;
  color: grey;
  text-decoration: underline;
}
.license-div .license-options {
  width: 100%;
  bottom: 0px;
  margin: 20px auto;
  text-align: center;
  align-content: center;
}
.license-div textarea {
  padding: 0px 15px;
  padding-top: 12px;
  font-size: 14px;
  margin-bottom: 10px;
  display: inline-block;
  width: 100%;
  height: 135px;
  vertical-align: middle;
  resize: none;
  transition: all 0.3s;
  border-radius: 5px;
  border: none;
  text-overflow: ellipsis;
  box-shadow: 0 1px 12px 0 rgba(51, 51, 51, 0.09);
  box-sizing: border-box;
}
.license-div textarea:focus {
  box-shadow: 0 1px 12px 0 rgba(51, 51, 51, 0.18);
}
.license-div .activation-result-div .activation-successful-div {
  height: 75px;
  margin-bottom: 20px;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
}
.license-div .activation-result-div .activation-failed-div {
  height: 75px;
  margin-bottom: 20px;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  font-size: 14px;
  line-height: 19px;
}
.license-div button {
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  width: 100%;
  height: 50px;
  cursor: pointer;
  background-color: #000000;
  color: white;
  font-size: 16px;
  font-weight: bold;
  line-height: 22px;
  margin-bottom: 10px;
  display: inline-block;
  border: none;
  vertical-align: middle;
  border-radius: 5px;
  text-overflow: ellipsis;
  transition: all 0.3s;
}
.license-div button:hover {
  box-shadow: 0 1px 12px 0 rgba(51, 51, 51, 0.18);
}
.license-div .button-div-horizontal {
  display: flex;
  align-content: center;
  justify-content: space-evenly;
}
.license-div .button-div-horizontal > :only-child {
  margin-left: auto;
  margin-right: auto;
}
.license-div .buy-btn {
  font-size: 16px;
  font-weight: bold;
  line-height: 22px;
}
.license-div .license-yes-no {
  height: 30px;
  width: 60px;
  font-size: 14px;
  font-weight: 600;
}
.license-div .enter-key-btn {
  height: 30px;
  width: auto;
  font-size: 14px;
  background: none;
  color: black;
  font-weight: 600;
}
.license-div .confirm-btn-inactive {
  cursor: default !important;
  background-color: lightgray !important;
}
.license-div .confirm-btn-inactive:hover {
  box-shadow: none !important;
}
.license-div .confirm-btn-inactive:focus {
  outline: none;
}
.license-div .confirm-disable {
  text-align: center;
}
.license-div .info-div {
  margin-bottom: 10px;
}
.license-div .info-div .info-div-option {
  height: 49px;
  display: flex;
  align-items: center;
  padding-left: 30px;
  font-size: 14px;
  font-weight: 300;
  line-height: 19px;
  transition: all 0.3s;
}
.license-div .info-div .info-div-option:hover {
  background-color: #D1D6DD;
}
.license-div .info-div .rate-icon {
  width: 25px;
  height: 25px;
  margin-right: 9px;
  background-image: url("data:image/png;base64,");
  background-repeat: no-repeat;
}
.license-div .info-div .feedback-icon {
  width: 25px;
  height: 25px;
  margin-right: 9px;
  background-image: url("data:image/png;base64,");
  background-repeat: no-repeat;
}
.license-div .info-div .top-features-icon {
  width: 25px;
  height: 25px;
  margin-right: 9px;
  background-image: url("data:image/png;base64,");
  background-repeat: no-repeat;
}
.icon-div {
  position: absolute;
  right: 0px;
  top: 0px;
  transition: right 0.1s ease-in;
  z-index: 2;
}
.icon-div svg g path {
  fill: #c8c8c8;
}
.icon-div .license-logo {
  width: 76px;
  height: 19px;
  background-image: url("data:image/svg+xml;base64,");
  background-size: 76px 19px;
  background-repeat: no-repeat;
}
.icon-div:hover svg g path {
  fill: #231f20;
}
.icon-div:hover .license-logo {
  background-image: url("data:image/svg+xml;base64,");
}
.license-info-div {
  margin-bottom: 20px;
}
.license-info-div p {
  margin-top: 0px;
  margin-bottom: 5px;
}
.license-info-div .license-type-text {
  font-size: 14px;
  line-height: 19px;
}
.license-info-div .license-company-text {
  font-size: 11px;
  font-weight: 300;
  letter-spacing: 0.18px;
}
.license-info-div .license-trial-text {
  display: inline;
  color: rgba(0, 0, 0, 0.5);
  background-color: rgba(0, 0, 0, 0.1);
  font-size: 11px;
  line-height: 15px;
  letter-spacing: 0.18px;
  border-radius: 13px;
  padding: 2px 7px;
}
.license-info-div .license-red-text {
  display: inline;
  color: #FF7052;
  background-color: rgba(255, 112, 82, 0.1);
  font-size: 11px;
  line-height: 15px;
  letter-spacing: 0.18px;
  border-radius: 13px;
  padding: 2px 7px;
}
.license-info-div .enter-new-license-text {
  display: inline;
  color: rgba(0, 0, 0, 0.6);
  font-size: 11px;
  line-height: 15px;
  letter-spacing: 0.18px;
  padding-left: 2px;
}
.license-info-div .enter-new-license-text:hover {
  text-decoration: underline;
}
.license-green-text {
  display: inline;
  color: #00B750;
  background-color: #E9F9F0;
  font-size: 11px;
  line-height: 15px;
  letter-spacing: 0.18px;
  border-radius: 13px;
  padding: 2px 7px;
}
.license-footer {
  margin-top: 2px;
  margin-bottom: 12px;
  padding: 0px 30px;
  font-size: 12px;
  font-weight: 300;
  line-height: 17px;
  color: rgba(0, 0, 0, 0.6);
  display: flex;
  align-content: center;
  justify-content: space-between;
}
.license-footer div {
  display: inline-block;
}
.license-footer a {
  display: inline-block;
  color: inherit;
}
.license-footer a:hover {
  text-decoration: underline;
}
.license-footer .separator {
  color: rgba(0, 0, 0, 0.08);
}
.license-footer .question-mark {
  margin-right: 3px;
  border-radius: 50%;
  border: 1px solid rgba(0, 0, 0, 0.6);
  width: 17px;
  text-align: center;
}
.license-footer .question-mark:hover {
  background: #eee;
}
.checkmark {
  width: 56px;
  height: 56px;
  border-radius: 50%;
  display: block;
  margin: 10px auto;
  stroke-width: 2;
  stroke: white;
  stroke-miterlimit: 10;
  box-shadow: inset 0px 0px 0px green;
  animation: fill 0.4s ease-in-out 0.4s forwards, scale 0.3s ease-in-out 0.9s both;
}
.checkmark__circle {
  stroke-dasharray: 166;
  stroke-dashoffset: 166;
  stroke-width: 2;
  stroke-miterlimit: 10;
  stroke: green;
  fill: none;
  animation: stroke 0.6s cubic-bezier(0.65, 0, 0.45, 1) forwards;
}
.checkmark__check {
  transform-origin: 50% 50%;
  stroke-dasharray: 48;
  stroke-dashoffset: 48;
  animation: stroke 0.3s cubic-bezier(0.65, 0, 0.45, 1) 0.8s forwards;
}
@keyframes stroke {
  100% {
    stroke-dashoffset: 0;
  }
}
@keyframes scale {
  0%,
  100% {
    transform: none;
  }
  50% {
    transform: scale3d(1.1, 1.1, 1);
  }
}
@keyframes fill {
  100% {
    box-shadow: inset 0px 0px 0px 30px green;
  }
}
.activation-success-animation {
  transition: all 0.2s;
  height: 195px;
  margin-bottom: 10px;
  padding-top: 40px;
  box-sizing: border-box;
}
