  margin-left: 15%;
  margin-right: 15%;
  margin-top: 25px;
  margin-bottom: 25px;
  max-width: 1200px;
}
.zbialternate {
  background-color: #f6f6f6;
  color: #666666;
  margin: 0 auto;
  position: static;
  width: 100%;
  clear: both;
  float: left;
  min-height: 1px;
  padding: 10px 10px 20px 10px;
}
@media screen and (max-width: 1100px) {
  .zbibody {
    margin-left: 10%;
    margin-right: 10%;
    margin-top: 25px;
    margin-bottom: 25px;
  }
}
@media screen and (max-width: 800px) {
  .zbibody {
    margin-left: 5%;
    margin-right: 5%;
    margin-top: 5px;
    margin-bottom: 5px;
  }
  .zbialternate {
    padding: 5px 0px 15px 0px;
  }
}
.zbi-license-header {
  height: 58px;
  margin-left: 5%;
  margin-right: 5%;
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: white;
}
.zbi-license-logo {
  width: 99px;
  height: 20px;
  background-image: url("data:image/svg+xml;base64,");
  background-size: 99px 20px;
  background-repeat: no-repeat;
}
.zbi-product-text {
  font-size: 14px;
  line-height: 19px;
  margin: 5px;
  margin-left: 0;
}
.zbi-licensed-to-text {
  display: inline;
  color: rgba(0, 0, 0, 0.5);
  background-color: rgba(0, 0, 0, 0.1);
  font-size: 11px;
  line-height: 15px;
  letter-spacing: 0.18px;
  border-radius: 13px;
  padding: 2px 7px;
}
.zbi-learn-more {
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  cursor: pointer;
  color: black;
  font-size: 14px;
  margin-top: 10px;
  font-weight: bold;
  display: inline-block;
  vertical-align: middle;
  text-overflow: ellipsis;
  border: 1px solid black;
  border-radius: 3px;
  padding: 6px;
  background: white;
}
.zbi-learn-more:hover {
  color: #555;
  border: 1px solid #555;
}
.zbi-container {
  display: flex;
  justify-content: center;
}
.zbi-info {
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: flex-start;
}


